import { useSelector } from 'react-redux'
import FriendComponent from '../../components/friendComponent/friendComponent'
import './friends.css'
const Friend = () => {
    const friends = useSelector((state:any) => state.friends.friends)
    return (
        <div className='friend-screen__container'>
            {friends ? friends.map((item) => {return <FriendComponent imageUrl={item.ProfilePic} name={item.Name} status={item.isOnline}/>}):<h1>No Friends, Why so lonely ??</h1>}
        </div>
    )
}
export default Friend
